import { useState, useEffect } from "react";
import styled from "styled-components";
import Main from "./Components/Main";
import Spinner from "./Components/Main";
import "./App.css";

const importData = async () => import("./trajectoires.json");

const Wrapper = styled.div`
  width: 100vw;
  height: 100vh;
  background: #282c34;
`;

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    // Setting the data state asynchronously
    // in case of huge dataset import
    // we'll be able to display a loader
    importData().then(({ default: def, ...rest }) =>
      // setTimeout(() => setData(rest), 1000)
      setData(rest)
    );
  }, []);

  return <Wrapper>{!data ? <Spinner /> : <Main data={data} />}</Wrapper>;
}

export default App;
